            foreach (var day in casinoCartDays)
            {
                var stock = TravelingCart.GetStock(id, day);

                string info = "";

                foreach(var item in stock)
                {
                    if (curate)
                    {
                        //Console.WriteLine(item.ToString());
                    }
                    switch (item.Id)
                    {
                        case "284":
                            if (item.Quantity == 5)
                            {
                                beets += item.Quantity;
                                info += $" Beets({item.Cost*5}),";
                                neededCost += item.Cost * 5;
                                usefulDays.Add(day);
                            }
                            break;

                        case "394":
                            info += $" Rainbow Shell({item.Cost}),";
                            //usefulDays.Add(day);
                            break;

                        case "768":
                            solarEssence = true;
                            info += $" Solar Essence({item.Cost}),";
                            neededCost += item.Cost;
                            usefulDays.Add(day);
                            break;

                        case "787":
                            info += $" Battery Pack({item.Cost}),";
                            //usefulDays.Add(day);
                            break;
                    }
                }
                if (info != "")
                {
                    info = day.ToString() + ":" + info;
                    cartInfo.Add(info);
                }
            }

            int wins = 0;
            int timesPlayed = -1;
            while (wins < 20)
            {
                timesPlayed++;
                if (CalicoJack.CalculateHand(timesPlayed, 28 * 2 + 7, id) == -1)
                {
                    wins = 0;
                    continue;
                }

                wins += 1;
            }
            if (timesPlayed > 120)
            {
                return false;
            }
            if (usefulDays.Count > 4) { return false; }
            if (beets < 10 || !solarEssence)
            {
                return false;
            }
            if (curate)
            {
                int count = usefulDays.Count;
                Console.WriteLine($"{id};Fairy:{fairyDay};{String.Join("\t", rareSeedInfo)};{String.Join("\t",cartInfo)};CalicoJack: {timesPlayed-20};UsefulDays:{count};cost:{neededCost}" );
            }

            return true;
        }

        // parallel search
        public static double Search(int numSeeds, int blockSize, out List<int> validSeeds)
        {
            Stopwatch stopwatch = Stopwatch.StartNew();
            var bag = new ConcurrentBag<int>();
            var partioner = Partitioner.Create(0, numSeeds, blockSize);
            Parallel.ForEach(partioner, (range, loopState) =>
            {
                for (int seed = range.Item1; seed < range.Item2; seed++)
                {
                    if (seed % 2 == 0)
                    {
                        continue;
                    }
                    if (ValidSeed(seed))
                    {
                        bag.Add(seed);
                    }
                }
            });
            double seconds = stopwatch.Elapsed.TotalSeconds;
            Console.WriteLine($"Found: {bag.Count} sols in {seconds.ToString("F2")} s");
            validSeeds = bag.ToList();
            validSeeds.Sort();
            return seconds;
        }
    }
